job.extended_description:
Obtiene los datos de perscripción de insulina, administración iv de insulina y eventos de glucosa de las tablas intermedias
ADMINIV_INSULIN -------------------------- update dp_icu_stays di set icu_has_admiv_insulin=true where exists( select null from dp_admin_insulin dp where dp.icu_id=di.icu_id); update dp_icu_stays set icu_has_admiv_insulin=false where icu_has_admiv_insulin is null;
PRESC_INSULIN -------------------------- update dp_icu_stays di set icu_has_presc_insulin=true where exists( select null from dp_presc_insulin dp where dp.icu_id=di.icu_id); update dp_icu_stays set icu_has_presc_insulin=false where icu_has_presc_insulin is null;
EVENT_GLUCOSE --------------------------- update dp_icu_stays di set icu_has_event_glucose=true where exists( select null from dp_icu_events de where de.icu_id=di.icu_id and de.event_type='GLUCOSE');
update dp_icu_stays set icu_has_event_glucose=false where icu_has_event_glucose is null;

entry.sql:
alter table dp_icu_stays add ICU_HAS_PRESC_INSULIN BOOLEAN;
alter table dp_icu_stays add ICU_HAS_ADMIV_INSULIN BOOLEAN;
alter table dp_icu_stays add ICU_HAS_EVENT_GLUCOSE BOOLEAN;

update dp_icu_stays di set icu_has_presc_insulin=true 
where exists(
	select null from dp_presc_insulin dp where dp.icu_id=di.icu_id);
update dp_icu_stays set icu_has_presc_insulin=false 
where icu_has_presc_insulin is null;

update dp_icu_stays di set icu_has_admiv_insulin=true 
where exists(
	select null from dp_admin_insulin dp where dp.icu_id=di.icu_id);
update dp_icu_stays set icu_has_admiv_insulin=false 
where icu_has_admiv_insulin is null;
